func GetCSRState(logger log.Logger) []csrtypes.CSR {
	var csrs []csrtypes.CSR
	lines := strings.Split(strings.TrimSpace(CsrsState), "\n")
	for _, line := range lines {
		parseData, err := parseLine(logger, line)
		if err != nil {
			fmt.Println("error parsing line: ", err)
			continue
		}
		csrs = append(csrs, parseData)
	}
	return csrs
}

func parseLine(logger log.Logger, line string) (csrtypes.CSR, error) {
	re := regexp.MustCompile(`\{\[([^]]+)\]\s+(\d+)\s+(\d+)\s+(\d+)\}`)
	matches := re.FindStringSubmatch(line)
	if len(matches) != 5 {
		return csrtypes.CSR{}, fmt.Errorf("invalid line format")
	}

	addressesStr := matches[1]
	idStr := matches[2]
	txsStr := matches[3]
	revenueStr := matches[4]

	// Split addresses by space
	addresses := strings.FieldsFunc(addressesStr, func(r rune) bool {
		return r == ' ' || r == ']'
	})

	// Convert id, txs, revenue to integers
	id, err1 := strconv.ParseUint(idStr, 10, 64)
	txs, err2 := strconv.ParseUint(txsStr, 10, 64)
	revenue, err3 := sdkmath.NewIntFromString(revenueStr)

	if err1 != nil || err2 != nil || err3 != true {
		return csrtypes.CSR{}, fmt.Errorf("error parsing integers")
	}

	return csrtypes.CSR{
		Contracts: addresses,
		Id:        id,
		Txs:       txs,
		Revenue:   revenue,
	}, nil
}
